import React from 'react';
import "./styles.css";

function Navigation() {
    return (
        <div>
            <section>
                <div id="navbar">
                    <a id="logo">SQ-DPT Logo</a>
                    <div id="navbar-right">
                        <a className="active">SQ-DPT</a>
                        <a>About</a>
                        <a>Contact</a>
                    </div>
                </div>
            </section>
        </div>
    );
}

export default Navigation;
